#include "Board.h"

void Board::drawCell(int x, int y, Color c, Graphics & gfx) const
{
	for (int i = placey+y*cellSize; i < placey + (y+1)*cellSize; i++)
		for (int a = placex+x*cellSize; a < placex + (x+1)*cellSize; a++)
			gfx.PutPixel(a, i, c);
}

void Board::drawCell(int x, int y, int r, int g, int b, Graphics & gfx) const
{
	for (int i = placey + y*cellSize; i < placey + (y + 1)*cellSize; i++)
		for (int a = placex + x*cellSize; a < placex + (x + 1)*cellSize; a++)
			gfx.PutPixel(a, i, r, g, b);
}

void Board::drawCell(Position z, int r, int g, int b, Graphics & gfx) const
{
	for (int i = placey + z.y * cellSize; i < placey + (z.y + 1)*cellSize; i++)
		for (int a = placex + z.x * cellSize; a < placex + (z.x + 1)*cellSize; a++)
			gfx.PutPixel(a, i, r, g, b);
}

