void Board::drawBorder(Graphics & gfx) const
{
	for (int i = placex - 5; i <= placex + width+5; i++)	// góra
	{
		if (i <= placex + width+1 && i >= placex - 1)
		gfx.PutPixel(i, placey - 1, 0, 255, 0);
		if (i <= placex + width+2 && i >= placex - 2)
		gfx.PutPixel(i, placey - 2, 0, 200, 0);
		if (i <= placex + width+3 && i >= placex - 3)
		gfx.PutPixel(i, placey - 3, 0, 145, 0);
		if (i <= placex + width+4 && i >= placex - 4)
		gfx.PutPixel(i, placey - 4, 0, 90, 0);
		if (i <= placex + width+5 && i >= placex - 5)
		gfx.PutPixel(i, placey - 5, 0, 35, 0);
	}
	for (int i = placex - 5; i <= placex + width+5; i++)	// dó³
	{
		if (i <= placex + width + 1 && i >= placex - 1)
		gfx.PutPixel(i, placey + height + 1, 0, 255, 0);
		if (i <= placex + width + 2 && i >= placex - 2)
		gfx.PutPixel(i, placey + height + 2, 0, 200, 0);
		if (i <= placex + width + 3 && i >= placex - 3)
		gfx.PutPixel(i, placey + height + 3, 0, 145, 0);
		if (i <= placex + width + 4 && i >= placex - 4)
		gfx.PutPixel(i, placey + height + 4, 0, 90, 0);
		if (i <= placex + width + 5 && i >= placex - 5)
		gfx.PutPixel(i, placey + height + 5, 0, 35, 0);
	}
	for (int i = placey-5; i <= placey + height+5; i++)	// lewo
	{
		if (i <= placey + height + 1 && i >= placey - 1)
		gfx.PutPixel(placex - 1, i, 0, 255, 0);
		if (i <= placey + height + 2 && i >= placey - 2)
		gfx.PutPixel(placex - 2, i, 0, 200, 0);
		if (i <= placey + height + 3 && i >= placey - 3)
		gfx.PutPixel(placex - 3, i, 0, 145, 0);
		if (i <= placey + height + 4 && i >= placey - 4)
		gfx.PutPixel(placex - 4, i, 0, 90, 0);
		if (i <= placey + height + 5 && i >= placey - 5)
		gfx.PutPixel(placex - 5, i, 0, 35, 0);
	}
	for (int i = placey-5; i <= placey + height+5; i++)	// prawo
	{
		if (i <= placey + height + 1 && i >= placey - 1)
		gfx.PutPixel(placex + width + 1, i, 0, 255, 0);
		if (i <= placey + height + 2 && i >= placey - 2)
		gfx.PutPixel(placex + width + 2, i, 0, 200, 0);
		if (i <= placey + height + 3 && i >= placey - 3)
		gfx.PutPixel(placex + width + 3, i, 0, 145, 0);
		if (i <= placey + height + 4 && i >= placey - 4)
		gfx.PutPixel(placex + width + 4, i, 0, 90, 0);
		if (i <= placey + height + 5 && i >= placey - 5)
		gfx.PutPixel(placex + width + 5, i, 0, 35, 0);
	}
}

Board::Board(Graphics & gfx)
{
	width = 560;
	height = 560;
	cellSize = 70;
	placex = (gfx.ScreenWidth - width)/2;
	placey = (gfx.ScreenHeight - height)/2;
}

